import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom'

import ttesttttt from "./pages/test";
import Home from "./pages/home";


function App() {
  return <div className='App'>
    <Router>
      <Routes>
          <Route path="/" element={<ttesttttt/>}/>
      </Routes>
    </Router>
    </div>;
}

export default App;
